import logo from './logo.svg';
import './App.css';
import { useState } from 'react';

function App() {
  const [prompt, setPrompt] = useState("");
  return (
    <div>
      <form>
        <label>Enter prompt:
          <input type="text" value={prompt} onChange={(e) => setPrompt(e.target.value)} />
        </label>
      </form>
    </div>
  );
}

export default App;
